        event: 'HARRY STYLES LOVE ON TOUR 2022',
        description:
            '<p><i><strong>HARRY STYLES \'LOVE ON TOUR\' SHOW EN BOGOTÁ EL DOMINGO 27 DE NOVIEMBRE SE TRASLADA AL COLISEO LIVE</strong></i></p><p>Hoy, OCESA anunció que el esperado show de la superestrella internacional Harry Styles \'Love On Tour\' en Bogotá, Colombia, se traslada del Parque Salitre Mágico al Coliseo Live. El concierto seguirá teniendo lugar en la fecha previamente programada, el domingo 27 de noviembre.</p><p>Las localidades adquiridas serán reubicadas en el Coliseo Live y los actuales poseedores de entradas recibirán una asignación actualizada de las mismas por correo electrónico a través de Tuboleta dentro de los siguientes días.&nbsp;</p><p>Styles’ Love On Tour 2022&nbsp; ya ha arrasado en Norteamérica convirtiendo lugares emblemáticos en Harry´House e interpretando canciones de su exitoso álbum <strong>Harry\'s House</strong>, como "As It Was", "Music for A Sushi Restaurant", "Late Night Talking" y muchas más. Su espectáculo también incluye canciones favoritas de los fans como "Golden", "Adore You" y "Watermelon Sugar".&nbsp;</p><p>&nbsp;</p><p><strong>Quienes ya cuentan con su entrada serán reubicados en el nuevo venue de la siguiente manera:</strong></p><p><strong>PLATINO</strong>:&nbsp;Los compradores de Platino deberán conservar sus entradas, que serán válidas en el nuevo escenario y serán ubicados en la localidad de Platino del COLISEO LIVE. Esta localidad seguirá siendo de admisión general, según el orden de llegada.</p><p>Aquellos que actualmente tienen el beneficio de la <i>Early Entrance</i> para la sección Platino podrán disfrutar de este beneficio también en el nuevo recinto.&nbsp;</p><p>Los compradores de entradas de Platino podrán acceder al evento con la entrada que ya han descargado, o que pueden descargar si aún no lo han hecho, desde su cuenta de Tuboleta.</p><p>&nbsp;</p><p><strong>GENERAL</strong>:&nbsp;quienes actualmente cuentan con su boleta de General serán reubicados en las LOCALIDADES DE GRADERÍAS (Secciones 100 a 124) del COLISEO LIVE. &nbsp;A partir del 2 de noviembre y durante los siguientes días,&nbsp;Tuboleta comunicará a cada uno de los compradores cuando su nueva boleta haya sido generada, con el nuevo asiento asignado, para ser descargada desde su cuenta Tuboleta. El área de servicio al cliente de Tuboleta estará atento a resolver las dudas respecto a la asignación de sillas.</p><p>Aquellos que actualmente tienen el beneficio de <i>Early Entrance</i> para la localidad General serán contactados por Tuboleta con información de este especial beneficio.</p><p>&nbsp;</p><p><strong>IMPORTANTE: Los compradores que no están de acuerdo con el cambio y deseen solicitar la devolución de su dinero, podrán hacerlo diligenciando este</strong> <a href="https://www.tuboleta.com/pqrs.html"><strong>formulario</strong></a><strong>&nbsp;a partir de hoy y máximo hasta el 25 de noviembre de 2022*.</strong></p><p>*Después de la fecha establecida y sin excepción alguna, no se admitirá ninguna reclamación conforme a lo establecido en el estatuto de protección al consumidor, en lo referente al término de garantía legal.</p><p>&nbsp;</p>',
