        description:
            '<p>En el vórtice de nuestro tiempo, contemporaneidad vibrante en la que somos más que testigos, protagonistas; se levanta nuestra generación. Más seguros de sí mismos y conscientes de de su valor, jóvenes afrodescendientes asumen la tarea de *abrir nuevas sendas y arriesgar las certezas que dictaba el pasado por las de un futuro que sea mucho más nuestro. *</p><p>Cargada de símbolos que tensionan el pasado y el presente, esta obra prefigura una versión del mañana mediante la danza como juicio futuro. Emplea un lenguaje alegórico que combina *elementos afro-futuristas con referentes que rodean la experiencia cotidiana de los bailarines. *</p><p>Esta propuesta no pretende negar la presencia de los ancestros, eternos antecesores que nos abrieron caminos. En cambio, busca asumir una nueva relación con la ancestralidad trayéndola al presente y eternizándola a través del trabajo cuidadoso de los ancestros del futuro, nuestra generación, para delinear con pasos firmes la silueta del mañana.</p>',
